INSERT INTO `berita` (`id_berita`, `id_user`, `id_kategori`, `updater`, `slug_berita`, `judul_berita`, `isi`, `status_berita`, `jenis_berita`, `keywords`, `gambar`, `icon`, `hits`, `urutan`, `tanggal_mulai`, `tanggal_selesai`, `tanggal_post`, `tanggal_publish`, `tanggal`, `id_sub_layanan`) VALUES
(2, 3, 5, '', 'sertifikasi-badan-usaha-sbu', 'Sertifikasi Badan Usaha SBU', '<div class=\"row news-row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"news-content\">\r\n<p>SBU Kontruksi dikeluarkan oleh Asosiasi Perusahaan melalui pemeriksaan dokumen perusahaan atau verifikasi oleh team USBU (Unit Sertifikasi Badan Usaha) dibawah naungan LPJK Nasional. Setelah melewati verifikasi USBU, maka SBU dapat dikeluarkan oleh asosiasi terkait dan disahkan oleh Lpjk Nasional.</p>\r\n<p>&nbsp; &nbsp; &nbsp;FUNGSI UTAMA SERTIFIKAT BADAN USAHA</p>\r\n<ol>\r\n<li>Sebagai persyaratan untuk mengajukan permohonan&nbsp;Izin Usaha Jasa Konstruksi (IUJK)</li>\r\n<li>Sebagai bukti formal perusahaan &nbsp;memiliki kompetensi melakukan kegiatan&nbsp;usaha jasa konstruksi</li>\r\n<li>Untuk&nbsp;dapat&nbsp;mengikuti Tender di instansi pemerintah atau proyek dilingkungan migas</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Dewan Pimpinan Pusat&nbsp;&nbsp;Asosiasi Kontraktor Nasional ( DPP ASKONAS ) membantu para pengusaha&nbsp; kontraktor Se-Indonesia dalam pengurusan SBU kualifikasi Kecil, Menengah, Besar.</p>\r\n</div>\r\n</div>\r\n</div>', 'Publish', 'Layanan', 'Sertifikasi SBU', NULL, 'fa fa-newspaper-o', 13, 4, NULL, NULL, '2019-05-17 04:15:33', '2019-05-17 04:06:15', '2021-11-05 03:31:18', ''),
(3, 3, 5, '', 'ohas-180012007-manajemen-k3', 'OHAS 18001:2007 (Manajemen K3)', '<p><strong>ISO 14000</strong>&nbsp;adalah kumpulan standar-standar terkait pengelolaan lingkungan yang disusun untuk membantu organisasi untuk:</p>\r\n<ol>\r\n<li>meminimalisir dampak negatif kegiatan-kegiatan (proses dll) mereka terhadap lingkungan, seperti menimbulkan perubahan yang merugikan terhadap udara, air atau tanah;</li>\r\n<li>mematuhi peraturan perundangan-undangan dan persyaratan-persyaratan berorientasi lingkungan yang berlaku;</li>\r\n<li>memperbaiki hal-hal di atas secara berkelanjutan.</li>\r\n</ol>\r\n<p>ISO 14000 serupa dengan ISO 9000&nbsp;- manajemen mutu dalam hal berkaitan dengan bagaimana sebuah produk diproduksi ketimbang tentang produk itu sendiri. Sebagaimana halnya ISO 9000, sertifikasinya dilakukan oleh pihak ketiga, bukan oleh ISO sendiri. Standar audit ISO 19001 diterapkan saat mengaudit ketaatan ISO 9000 dan 14000 sekaligus.</p>\r\n<p>&nbsp;</p>\r\n<p>Dewan Pimpinan Pusat&nbsp;&nbsp;Asosiasi Kontraktor Nasional ( DPP ASKONAS ) menjalin&nbsp;&nbsp;kerja sama dengan Lembaga Sertifikasi Manajemen Sistem&nbsp; :</p>\r\n<p>&nbsp;</p>\r\n<p>1. LS MIGG :</p>\r\n<p>&nbsp; &nbsp; website :&nbsp;&nbsp;<a href=\"http://mutuindonesia.co.id/\">http://mutuindonesia.co.id</a></p>\r\n<p>2. LS&nbsp;BILKEV :</p>\r\n<p>&nbsp; &nbsp; &nbsp;website :<a href=\"http://bilkev.co.id/\">http://bilkev.co.id/</a></p>\r\n<p>3. LS KIS</p>\r\n<p>&nbsp; &nbsp; website&nbsp;<a href=\"http://kiscerti.co.id/\">http://kiscerti.co.id/</a></p>', 'Publish', 'Layanan', 'ISO 45001:2018 (Manajemen K3)', NULL, 'fa fa-globe', 9, 3, NULL, NULL, '2019-05-17 04:37:00', '2019-05-17 04:36:19', '2021-11-05 03:25:13', '2'),
(4, 3, 5, '', 'kode-etik-panca-krida-askonas', 'KODE ETIK PANCA KRIDA ASKONAS', '<p>Menyadari peran sebagai pelaksana konstruksi yang merupakan bagian tak terpisahkan dari masyarakat jasa konstruksi pada khususnya dan rakyat Indonesia pada umumnya dan dalam rangka mewujudkan pembangunan ekonomi nasional yang sehat untuk mencapai masyarakat adil dan makmur berdasarkan Pancasila dan UUD 1945, ASKONAS menetapkan Kode Etik yang merupakan pedoman perilaku bagi para anggota di dalam menghayati dan melaksanakan tugas dan kewajiban masing-masing, dengan nama&nbsp;<strong>\"Panca Krida\",</strong>&nbsp;sebagai berikut :</p>\r\n<ol>\r\n<li>Berjiwa Pancasila yang berarti satunya kata dan perbuatan didalam menghayati dan mengamalkannya.</li>\r\n<li>Memiliki kesadaran Nasional yang tinggi, dengan mentaati semua perundang undangan dan peraturan serta menghindarkan diri dari perbuatan tercela ataupun melawan hukum.</li>\r\n<li>Penuh rasa tanggung jawab di dalam menjalankan profesi dan usahanya.</li>\r\n<li>Bersikap adil, wajar, tegas, bijaksana dan arif serta dewasa dalam bertindak.</li>\r\n<li>Tanggap terhadap kemajuan dan selalu berikhtiar untuk meningkatkan mutu, keahlian, kemampuan dan pengabdian usahanya.&nbsp;</li>\r\n</ol>', 'Publish', 'Profil', 'Kode Etik Pancakrida Askonas', 'logo_askonas1.png', '', 7, 2, NULL, NULL, '2019-07-26 10:38:15', '2019-07-26 10:36:47', '2021-10-28 03:15:34', ''),
(6, 3, 5, '', 'visi-dan-misi', 'Visi dan Misi', '<ol>\r\n<li>Menghimpun Perusahaan-perusahaan Nasional di bidang Usaha Jasa Pelaksana Konstruksi di dalam satu wadah organisasi ASKONAS, demi</li>\r\n<li>Membina dan mengembangkan kemampuan usaha anggota.</li>\r\n<li>Membina dan mengembangkan tertib hukum dan iklim usaha yang sehat.</li>\r\n<li>Mewujudkan rasa kesetiakawanan sesama anggota dan menjauhkan diri dari persaingan yang tidak sehat dalam menjalankan usahanya.</li>\r\n<li>Mewujudkan pelaksana konstruksi yang berkeahlian, berkemampuan, tanggap terhadap kemajuan dan bertanggungjawab dalam pengabdian usahanya baik nasional maupun global.&nbsp;</li>\r\n<li>Mewujudkan struktur Usaha Jasa Pelaksana Konstruksi Nasional yang kokoh dan andal menuju pembangunan ekonomi nasional yang sehat untuk kesejahteraan rakyat, persatuan dan kesatuan bangsa.</li>\r\n<li>Mengadakan kerjasama dengan lembaga-lembaga di bidang teknologi dan manajemen pembangunan, baik di dalam maupun di luar negeri.</li>\r\n<li>Memberi penyuluhan, bimbingan, bantuan dan melindungi serta memperjuangkan kepentingan anggota.</li>\r\n<li>Membina para anggotanya agar berkepribadian dan berbudi luhur dengan mentaati Kode Etik Panca Krida serta meningkatkan rasa tanggung jawab di dalam menjalankan profesinya.</li>\r\n</ol>', 'Publish', 'Profil', 'Visi dan Misi', NULL, '', 10, 1, NULL, NULL, '2021-10-03 14:18:02', '2021-10-03 14:15:58', '2021-10-28 03:15:22', ''),
(8, 3, 5, '', 'konsultasi-perijinan-konstruksi', 'Konsultasi Perijinan Konstruksi', '<p>Dewan Pimpinan Pusat Asosiasi Kontraktor Nasional ( DPP ASKONAS ) memberikan pelayanan konsultasi terkait peraturan dan perijinan jasa konstruksi .</p>', 'Publish', 'Layanan', 'Konsultasi Perijinan Kontruksi', NULL, '', 3, 0, NULL, NULL, '2021-10-26 14:41:16', '2021-10-26 14:40:11', '2021-10-28 03:16:17', ''),
(9, 3, 5, '', 'iso-450012018-manajemen-k3', 'ISO 45001:2018 (Manajemen K3)', '<p>ISO 45001:2018 ?&nbsp;<em>Occupational health and safety management systems&nbsp;? Requirements with guidance for use</em>, telah rilis pada tanggal 12 Maret 2018. ISO 45001:2018 adalah standar internasional pertama di dunia yang menetapkan persyaratan atau pedoman untuk sistem manajemen keselamatan dan kesehatan kerja (SMK3).</p>\r\n<p>ISO 45001:2018 dapat dikatakan sebagai&nbsp;<em>\"milestone\"</em>. Standar ini menyediakan kerangka kerja yang kuat dan efektif untuk mengurangi risiko di tempat kerja dan menciptakan tempat kerja yang aman dan sehat untuk pekerja, kontraktor, pemasok, pengunjung, dan tamu, yang memungkinkan sebuah organisasi untuk proaktif meningkatkan kinerja SMK3-nya.</p>\r\n<p>Dewan Pimpinan Pusat&nbsp;&nbsp;Asosiasi Kontraktor Nasional ( DPP ASKONAS ) menjalin&nbsp;&nbsp;kerja sama dengan Lembaga Sertifikasi Manajemen Sistem&nbsp; :</p>\r\n<p>&nbsp;</p>\r\n<p>1. LS MIGG :</p>\r\n<p>&nbsp; &nbsp; website :&nbsp;&nbsp;<a href=\"http://mutuindonesia.co.id/\">http://mutuindonesia.co.id</a></p>\r\n<p>2. LS&nbsp;BILKEV :</p>\r\n<p>&nbsp; &nbsp; &nbsp;website :<a href=\"http://bilkev.co.id/\">http://bilkev.co.id/</a></p>\r\n<p>3. LS KIS</p>\r\n<p>&nbsp; &nbsp; website&nbsp;<a href=\"http://kiscerti.co.id/\">http://kiscerti.co.id/</a></p>', 'Publish', 'Layanan', 'ISO 45001:2018 (Manajemen K3)', NULL, '', 8, 1, NULL, NULL, '2021-10-26 14:51:55', '2021-10-26 14:49:55', '2021-10-28 03:16:10', '2'),
(10, 3, 5, '', 'pelatihan-k3-bnsp', 'Pelatihan K3 BNSP', '<div class=\"row news-row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"news-content\">\r\n<p>Ada&nbsp; beberapa layanan pada Pelatihan K3 BNSP sebagai berikut :</p>\r\n<ol>\r\n<li>Ahli K3 Muda BNSP</li>\r\n<li>Ahli K3 Konstruksi</li>\r\n<li>Ahli K3 Migas BNSP</li>\r\n<li>Akuntasi</li>\r\n<li>Lingkungan</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Dewan Pimpinan Pusat&nbsp;&nbsp;Asosiasi Kontraktor Nasional ( DPP ASKONAS ) menjalin&nbsp;&nbsp;kerja sama dengan Lembaga Pelatihan K3 &nbsp; &nbsp;:</p>\r\n<p>&nbsp;</p>\r\n<p>1. PT Kualitas Indonesia Sistem ( KIS)</p>\r\n<p>&nbsp; &nbsp; &nbsp; informasi website :&nbsp;<a href=\"http://kiscerti.co.id/\">http://kiscerti.co.id/</a></p>\r\n</div>\r\n</div>\r\n</div>', 'Publish', 'Layanan', 'Pelatihan K3 BNSP', NULL, '', 6, 1, NULL, NULL, '2021-10-26 14:54:46', '2021-10-26 14:53:51', '2021-10-28 03:16:04', '1'),
